import React from 'react'
import './Message.css';
import Avatar from './Avatar'

function Message() {
    let nick = 'nick'
    if (user) nick = user.email.slice(0, user.email.indexOf('@'));

    return (
        <div className='message'>
            <Avatar />
            <p>{nick}</p>
        </div>
    )
}

export default Message
